$("a.view_duplicate").click(function(a){a.preventDefault();var e=$(this).attr("duplicate_id");$.ajax({url:$("#base_url").val()+"manager/view_duplicate",type:"POST",data:{duplicate_id:e},success:function(a){$("div.view_duplicate").html("").html(a)},complete:function(){$(".view_duplicate_modal").modal("show")}})});